import {ReactComponent as InputSvg} from "./temp/input.svg";
import {ReactComponent as OutputSvg} from "./temp/output.svg";

export default function Images() {
    return <div className="Images">
        <div className="Images-input">
            <InputSvg />
        </div>
        <div className="Images-output">
            <OutputSvg />
        </div>
    </div>
}
